  state = {
    data: {},
  };
  
  async componentDidMount() {
    let data = await axios.get(
      `http://localhost:5000/renderImage/unnamed.jpg`
    );
    data = data.data;
    console.log("data", data); 
    this.setState({data});
  }


  render() {
    
      // try {
